import React from "react";
import Header from "../Components/Header";
import About from "../Components/About";

function AboutPage(props) {
  return (
    <div>
      <Header mainHeader={props.mainHeader} />
      <About>Hello World</About>
    </div>
  );
}

export default AboutPage;
